/*
Songs (song_id, album, track_number, song_title, song_url, song_length, 
Artist_Credits (artcred_id, song_id, artcred_text)
Song_Credits (songcred_id, song_id, songcred_text)
Remixes (remix_id, song_id, beingremixed_id)
Special_Remixes (specialremix_id, song_id, beingsremixed_name)
Commentaries (commentary_id, song_id, commentary_url)
*/

CREATE DATABASE IF NOT EXISTS hs_music_db;

USE hs_music_db;

CREATE TABLE IF NOT EXISTS Songs
(
song_id int NOT NULL,
album varchar(255) NOT NULL,
track_number int NOT NULL,
song_title varchar(255) NOT NULL,
song_url varchar(255) NOT NULL,
song_length varchar(255) NOT NULL,
PRIMARY KEY (song_id)
);

CREATE TABLE IF NOT EXISTS Artist_Credits
(
artcred_id int NOT NULL AUTO_INCREMENT,
song_id int NOT NULL,
artcred_text varchar(255) NOT NULL,
PRIMARY KEY (artcred_id),
FOREIGN KEY (song_id) REFERENCES Songs(song_id)
);

CREATE TABLE IF NOT EXISTS Song_Credits
(
songcred_id int NOT NULL AUTO_INCREMENT,
song_id int NOT NULL,
songcred_text varchar(255) NOT NULL,
PRIMARY KEY (songcred_id),
FOREIGN KEY (song_id) REFERENCES Songs(song_id)
);

CREATE TABLE IF NOT EXISTS Remixes
(
remix_id int NOT NULL AUTO_INCREMENT,
song_id int NOT NULL,
beingremixed_id int NOT NULL,
PRIMARY KEY (remix_id),
FOREIGN KEY (song_id) REFERENCES Songs(song_id),
FOREIGN KEY (beingremixed_id) REFERENCES Songs(song_id)
);

CREATE TABLE IF NOT EXISTS Special_Remixes
(
specialremix_id int NOT NULL AUTO_INCREMENT,
song_id int NOT NULL,
beingsremixed_name varchar(255) NOT NULL,
PRIMARY KEY (specialremix_id),
FOREIGN KEY (song_id) REFERENCES Songs(song_id)
);

CREATE TABLE IF NOT EXISTS Commentaries
(
commentary_id int NOT NULL AUTO_INCREMENT,
song_id int NOT NULL,
commentary_url varchar(255) NOT NULL,
PRIMARY KEY (commentary_id),
FOREIGN KEY (song_id) REFERENCES Songs(song_id)
);





